import './App.css';
import Nav from './components/nav';
import Card from './components/card';


function App() {
  return (
    <>
      <Nav/> 
      <div className="container-card">
      <Card/>
      <Card/>
      <Card/>
      <Card/>
      </div>

    </>
    );
}

export default App;
